import React, { useState } from "react";
import Location from "../images/Location.svg";
import PhoneIcon from "../images/Call.png";
import MailIcon from "../images/Mail.png";
import LinkedIcon from "../images/Linked.svg";
import FacebookIcon from "../images/Facebook.svg";
import InstagramIcon from "../images/Instagram.svg";
import "../styles_css/Contact.css";

const Contact = () => {
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [isSubmitted, setIsSubmitted] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    setTimeout(() => {
      setIsSubmitting(false);
      setIsSubmitted(true);
      e.target.reset(); // Reset the form fields
    }, 2000); // Simulate API call delay
  };

  return (
    <div className="contact-page">
      <div className="container">
        {/* Left Container */}
        <div className="contact-info">
          <div>
            <span className="highlight">We'd Love to Hear From You</span>
          </div>
          <p>
            For inquiries or further assistance, please contact us through our
            website or reach out directly via email or phone.
          </p>

          <div className="info-list">
            <div className="info-item">
              <img src={PhoneIcon} alt="Phone" className="icon" />
              <span>+41767354845</span>
            </div>
            <div className="info-item">
              <img src={MailIcon} alt="Mail" className="icon" />
              <span>office@protecht.ch</span>
            </div>
            <div className="info-item">
              <img src={Location} alt="Location" className="icon" />
              <div>
                <p>Zugerstrasse 72, 6340 Baar</p>
                <p>Switzerland</p>
              </div>
            </div>
          </div>

          <div className="social-links">
            <a
              href="https://www.linkedin.com/company/protechtch/posts/?feedView=all"
              className="social-icon"
            >
              <img src={LinkedIcon} alt="LinkedIn" className="icon" />
            </a>
            <a
              href="https://www.facebook.com/protecht.ch/"
              className="social-icon"
            >
              <img src={FacebookIcon} alt="Facebook" className="icon" />
            </a>
            <a
              href="https://www.instagram.com/protecht_ch"
              className="social-icon"
            >
              <img src={InstagramIcon} alt="Instagram" className="icon" />
            </a>
          </div>
        </div>

        {/* Right Container */}
        <div className="contact-form">
          {isSubmitted ? (
            <div className="popup">
              <p>Your message has been sent successfully!</p>
              <button onClick={() => setIsSubmitted(false)}>Close</button>
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              {isSubmitting && <div className="spinner">Loading...</div>}
              <div className="form-group">
                <input type="text" placeholder="First name" required />
                <input type="text" placeholder="Last name" required />
              </div>
              <input type="email" placeholder="Email" required />
              <input type="tel" placeholder="Phone number" />
              <textarea placeholder="Leave a message..." rows="6"></textarea>
              <button type="submit" disabled={isSubmitting}>
                Send message
              </button>
            </form>
          )}
        </div>
      </div>
    </div>
  );
};

export default Contact;
